`,p.jsxs(e.p,{children:["Bei Vektorgrafiken wird der Bildinhalt immer mit mathematischen Formen beschrieben. Das bedeutet das wir ein Programm bentigen, das diese Beschreibungen lesen kann und das gewnschte Bild dann darstellen kann. Wir beschrieben also nicht speziell welcher Pixel in welcher Farbe angemalt werden soll, sondern wir beschrieben die Formen die gezeichnet werden, mit Text. Fr einfache Bilder braucht das also nur sehr wenig Speicher, denn Text knnen wir mit ",p.jsx(e.code,{children:"1 Byte"})," pro Zeichen darstellen. Wir brauchen also deutlich weniger Speicherplatz, wenn wir ein sehr grosses Bild mit einfachen Formen beschreiben mchten. Die Limitationen sind offensichtlich, wir knnen nicht so etwas komplexes wie ein Foto mit einfachen Formen beschreiben."]}),`
