`,p.jsx(e.p,{children:"Vektorgrafiken werden immer dann verwendet, wenn der Bildinhalt mit mathematischen Formen beschrieben werden kann, und wenn das Bild in unterschiedlicher Grsse dargestellt werden soll, ohne dass das Bild verpixelt erschient. Oftmals werden solche Grafiken in Webseiten eingebaut, und dann kann die Farbe der Grafik im nachhinein noch von der Webseite angepasst werden."}),`
`,p.jsx(e.p,{children:"Ein weiterer Anwendungsbereich ist im Lernen. Man kann sehr leicht lernen wie man Inhalte mit Sprache beschreiben kann, so dass der Computer diese dann darstellen kann. Das ist sehr nahe beim Programmieren, ist aber nicht so komplex mit der Logik, daher ermglicht es Ihnen einen einfacheren Einstieg. Auch werden die LLMs immer wie besser, das bedeutet Sie knnen sich auch Grafiken von einer KI generieren lassen, und mssen dann nur noch kleine Anpassungen vornehmen."}),`
