`,p.jsxs(e.p,{children:[p.jsx(e.code,{children:"HTML"})," ist die Sprache in der die Struktur von einer Webseite beschrieben wird. Das hat noch nichts mit der Gestaltung zu tun, wir beschrieben nur die Struktur, also ob ein Element ein Titel ist, oder ob es ein Bild sein soll, oder ein Link. Dafr wird eine Sprache verwendet, die sich aus ",p.jsx(e.code,{children:"XML"})," entwickelt hat. Die Sprache ist sehr einfach und alles darin ist in Blcken aufgebaut. Zum Beispiel sieht ein Titel in ",p.jsx(e.code,{children:"HTML"})," so aus: ",p.jsx(e.code,{children:"<h1>Das ist ein Titel</h1>"}),". Elemente knnen aber auch Attribute haben, das sind Eigenschaften die nicht angezeigt werden, so kann man bei einem Link zum Beispiel sagen, auf welche Webseite man gelenkt werden soll, dass geht mit dem folgenden Element: ",p.jsx(e.code,{children:'<a href="https://www.gym-muttenz.ch">Gym Muttenz</a>'}),". Hier ist ",p.jsx(e.code,{children:"href"})," das Attribut, und der Wert darin, ist die Webseite zu der wir geleitet werden. Das was zwischen den ",p.jsx(e.code,{children:">...<"})," steht, ist immer das was auf der Webseite angezeigt wird."]}),`
